def interpolate(x1, y1, x2, y2, x):
    """Линейная интерполяция между двумя точками."""
    return y1 + (y2 - y1) * (x - x1) / (x2 - x1)
def interpolate_radius(data, R_target):
    """Интерполяция по радиусу в таблице для заданного R."""
    radius = data["radius"]
    alpha = data["alpha"]
    length = data["length"]

    for i in range(len(radius) - 1):
        if radius[i] <= R_target <= radius[i + 1]:
            R1, R2 = radius[i], radius[i + 1]
            alpha_target = interpolate(R1, alpha[i], R2, alpha[i + 1], R_target)
            length_target = interpolate(R1, length[i], R2, length[i + 1], R_target)
            return alpha_target, length_target
    raise ValueError("Радиус выходит за пределы таблицы!")
def interpolate_k(k_values, alpha_values, length_values, k_target):
    """Интерполяция по k."""
    for i in range(len(k_values) - 1):
        if k_values[i] <= k_target <= k_values[i + 1]:
            k1, k2 = k_values[i], k_values[i + 1]
            alpha_target = interpolate(k1, alpha_values[i], k2, alpha_values[i + 1], k_target)
            length_target = interpolate(k1, length_values[i], k2, length_values[i + 1], k_target)
            return alpha_target, length_target
    raise ValueError("k выходит за пределы диапазона!")
def interpolate_beta(beta_values, alpha_values, length_values, beta_target):
    """Интерполяция по углу beta."""
    for i in range(len(beta_values) - 1):
        if beta_values[i] <= beta_target <= beta_values[i + 1]:
            beta1, beta2 = beta_values[i], beta_values[i + 1]
            alpha_target = interpolate(beta1, alpha_values[i], beta2, alpha_values[i + 1], beta_target)
            length_target = interpolate(beta1, length_values[i], beta2, length_values[i + 1], beta_target)
            return alpha_target, length_target
    raise ValueError("Beta выходит за пределы диапазона!")



