def find_teta_m_1(R_otn,k_a,teta_a):
    if k_a<=1.10:
        k_a=1.10
    if k_a>=1.25:
        k_a=1.25
    beta_target=2*teta_a
    k_target = k_a  # Целевой коэффициент
    R_target = R_otn # Радиус на выходе

    beta_values = sorted(tables.keys())
    alpha_beta = []
    length_beta = []

    for beta in beta_values:
        k_values = sorted(tables[beta].keys())
        alpha_k = []
        length_k = []

        for k in k_values:
            alpha, length = interpolate_radius(tables[beta][k], R_target)
            alpha_k.append(alpha)
            length_k.append(length)

        alpha_target_k, length_target_k = interpolate_k(k_values, alpha_k, length_k, k_target)
        alpha_beta.append(alpha_target_k)
        length_beta.append(length_target_k)

    alpha_final, length_final = interpolate_beta(beta_values, alpha_beta, length_beta, beta_target)
    print(f"Угол на выходе = {beta_target}°, k_а = {k_target}, R_отн = {R_target} мм:")
    print(f"Угол на входе: {alpha_final:.3f} радиан")
    print(f"Длина относительная: {length_final:.3f}")
    return alpha_final,length_final